void InitBootstrap(SymbolTable symbolTable, ClosureInfo dest)
{
	Closure globalClosure = Closure_CreateGlobal(dest, NULL);

	SetupSymbols(symbolTable);
	FixupBytecode();
	SetupData(globalClosure);

	Setup_Object(dest);
	Setup_Number(dest);
	Setup_Real32(dest);
	Setup_Real64(dest);
	Setup_Float32(dest);
	Setup_Float64(dest);
	Setup_Enumerable(dest);
	Setup_List(dest);
	Setup_Fn(dest);
}

